import React from "react";
// import {
//   FaHome,
//   FaStar,
//   FaDoorOpen,
//   FaCalendarAlt,
//   FaShareAlt,
//   FaHeart,
// } from "react-icons/fa";
import "../components/ListingDetailsPage.css";

const ListingDetailsPage = () => {
  return (
    <div className="property-page">
      {/* Header */}
      <header className="header">
        <div className="logo">
          <img src="logo.png" alt="Airbnb Logo" />
        </div>
        <div className="search-bar">
          <input type="text" placeholder="Start your search" />
        </div>
        <nav className="user-nav">
          <a href="#">Become a Host</a>
          <a href="#">Sign Up</a>
          <a href="#">Log in</a>
        </nav>
      </header>

      {/* Main Content */}
      <main>
        {/* Property Title and Rating */}
        <section className="property-header">
          <h1>Bordeaux Getaway</h1>
          <div className="rating">
            <span>4.8</span>
            <span> · 32 reviews · </span>
            <span>Superhost · Bordeaux, France</span>
          </div>
        </section>

        {/* Image Gallery */}
        <section className="image-gallery">
          <div className="main-image">
            <img src="https://a0.muscache.com/im/pictures/miso/Hosting-689791878132320331/original/0793b27c-c944-4d84-9eaa-741c8eb6e692.jpeg?im_w=720" alt="Main Property" />
